CREATE TABLE IF NOT EXISTS `attendence` (
  `attendence_id` int NOT NULL AUTO_INCREMENT,
  `date` date NOT NULL,
  `staff_id` int NOT NULL,
  `student_id` int NOT NULL,
  `attendence_status` varchar(50) DEFAULT NULL,
  PRIMARY KEY (`attendence_id`),
  KEY `FK_attendence_staff` (`staff_id`),
  KEY `FK_attendence_student` (`student_id`),
  CONSTRAINT `FK_attendence_staff` FOREIGN KEY (`staff_id`) REFERENCES `staff` (`staff_id`),
  CONSTRAINT `FK_attendence_student` FOREIGN KEY (`student_id`) REFERENCES `student` (`student_id`)
);

